/**
 * Created by zhangjinyang on 2018/5/24.
 */
public enum ERC20Enum {

  EOS("0x86fa049857e0209aa7d9e616f7eb3b3b78ecfdb0", 18,
      "", AssetCode.EOS),
  GTO("0xc5bbae50781be1669306b9e001eff57a2957b09d", 5,
      "", AssetCode.GTO),
  SALT("0x4156D3342D5c385a87D264F90653733592000581", 8,
      "60a0604052600360608190527ß", AssetCode.SALT),
  STORJ("0xb64ef51c888972c908cfacf59b47c1afbc0ab8ac", 8,
      "",AssetCode.STORJ),
  WTC("0xb7cb1c96db6b22b0d3d9536e0108d062bd488f74", 18,
      "",
      AssetCode.WTC),
  APPC("0x1a7a8bd9106f2b8d977e08582dc7d24c723ab0db", 18,
      "",AssetCode.APPC),
  TOPC("0x1b6c5864375b34af3ff5bd2e5f40bc425b4a8d79", 6,
      "",AssetCode.TOPC),
  OMG("0xd26114cd6EE289AccF82350c8d8487fedB8A0C07", 18,
      "",AssetCode.OMG),
  LRC("0xef68e7c694f40c8202821edf525de3782458639f", 18,
      "",AssetCode.LRC),
  MANA("0x0f5d2fb29fb7d3cfee444a200298f468908cc942", 18,
      "",AssetCode.MANA),
  NULS("0xb91318f35bdb262e9423bc7c7c2a3a93dd93c92c", 18,
      "",AssetCode.NULS),
  KNC("0xdd974d5c2e2928dea5f71b9825b8b646686bd200", 18,
      "",AssetCode.KNC),
  REP("0xe94327d07fc17907b4db788e5adf2ed424addff6", 18,
      "",AssetCode.REP),
  ZRX("0xe41d2489571d322189246dafa5ebde1f4699f498", 18,
      "",AssetCode.ZRX),
  GNT("0xa74476443119A942dE498590Fe1f2454d7D4aC0d", 18,
      "",AssetCode.GNT),
  LINK("0x514910771af9ca656af840dff83e8264ecf986ca", 18,
      "",AssetCode.LINK),
  PAY("0xB97048628DB6B661D4C2aA833e95Dbe1A905B280", 18,
      "",AssetCode.PAY),
  PLC("0xdf99c7f9e0eadd71057a801055da810985df38bd", 18,
      "",AssetCode.PLC);

  private String contractId;
  private Integer decimal;
  private String binary;
  private AssetCode assetCode;

  ERC20Enum(String contractId, Integer decimal, String binary, AssetCode assetCode) {
    this.contractId = contractId;
    this.decimal = decimal;
    this.binary = binary;
    this.assetCode = assetCode;
  }

  public String getContractId() {
    return contractId;
  }

  public void setContractId(String contractId) {
    this.contractId = contractId;
  }

  public Integer getDecimal() {
    return decimal;
  }

  public void setDecimal(Integer decimal) {
    this.decimal = decimal;
  }

  public String getBinary() {
    return binary;
  }

  public void setBinary(String binary) {
    this.binary = binary;
  }

  public AssetCode getAssetCode() {
    return assetCode;
  }

  public void setAssetCode(AssetCode assetCode) {
    this.assetCode = assetCode;
  }

  public static ERC20Enum fromContractId(String contractId) {
    for (ERC20Enum asset : ERC20Enum.values()) {
      if (asset.getContractId().equals(contractId)) {
        return asset;
      }
    }
    return null;
  }
  public static ERC20Enum fromAssetCode(AssetCode assetCode) {
    for (ERC20Enum asset : ERC20Enum.values()) {
      if (asset.getAssetCode().equals(assetCode)) {
        return asset;
      }
    }
    return null;
  }
}
